import React from 'react';

const UserManagementPage = () => {
    return (
        <div style={{ padding: "2rem" }}>
            <h1 style={{ fontSize: "24px", fontWeight: "bold", marginBottom: "1rem" }}>User Management</h1>
            <p>Manage system users, roles, and permissions here.</p>
        </div>
    );
};

export default UserManagementPage;
